@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://www.example.org/atm#> .

atm:ATM a owl:Class ;
  rdfs:subClassOf [ a owl:Restriction ;
      owl:onProperty atm:supportsTransactionType ;
      owl:someValuesFrom atm:ChipAndPIN ],
  [ a owl:Restriction ;
      owl:onProperty atm:supportsTransactionType ;
      owl:someValuesFrom atm:ContactlessCard ] .

atm:supportsTransactionType a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:TransactionType .

atm:TransactionType a owl:Class .

atm:ChipAndPIN a atm:TransactionType .

atm:ContactlessCard a atm:TransactionType .
